import react, { useState } from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {

  let [title, setTitle] = useState('레포데하고싶다')

  let 이것도가능 = { color: "blue", fontSize: "30px" };

  return (
    <div className="App">
      <div className="black-nav">
        <div style={이것도가능}>개발 Blog</div>
      </div>
      <div className="list">
        <h4> {title} </h4>
        <p>03월 10일</p>
        <hr />
      </div>
    </div>
  );
}

export default App;
